import React from 'react';
import '../assets/css/ToDos.css'

const List = (props) => {

  const toDos = props.toDos.map(toDo => <span>{toDo.task}</span>)
  console.log(props.toDos)

  return (
    <div className="list">
      {
      props.toDos.map(toDo => {
        <div className="todo-card">
          <input type="checkbox" />
          <span>{toDo.task}</span>
          <button>Delete</button>
        </div>
      })
      }
    </div>

  );
}

export default List;
